import React from 'react';

const Rank = ({ name,entries })=>{
    return(
        <div>
             {alert("Hi"+name +"Welcome Back!")}
            <div className='white f3'>{name+ ' your current number of entries is...'}</div>
            <div className='white f1'>{'#'+entries}</div>
        </div>
    );
}
export default Rank ;
